import styled, {css} from 'styled-components';
import Color from './color';

const {primary,success,danger,warning,info,
  primaryRGB,successRGB,dangerRGB,warningRGB,infoRGB,
  ff,ffRGB,fe,feRGB,fc,fcRGB,f9,f9RGB,f6,f6RGB,f3,f3RGB,f0,f0RGB,
  bg,bgRGB,bp,bpRGB,bs,bsRGB,bd,bdRGB,bw,bwRGB,bi,biRGB,
  primaryG,successG,dangerG,warningG,infoG,ffG,feG,fcG,f9G,f6G,f3G,f0G,bgG,bpG,bsG,bdG,bwG,biG
} = Color;

/*
* 媒体查询
* 分辨率: 0 ~ 767 手机 | 768 ~ 991 平板 | 992 ~ 1199 小屏幕电脑 | 1200 ~ * 大屏幕电脑
* 名称: phone 手机 | tablet 平板 | desktop 小屏幕电脑
* */
const sizes = {desktop: 1199,tablet: 991,phone: 767};
const media_container = Object.keys(sizes).reduce((acc,label) => {
  acc[label] = (...args) => css`
    @media (max-width: ${sizes[label] / 16}em) {
      ${css(...args)}
    }
`;
  return acc
},{});

/*
* 媒体查询
* 级别: maxDesktop,desktop tablet phone
* 状态:
* 限定分辨率显不显示，*b,显示 *n,隐藏
* 继承显不显示，*ba，自己和以下显示，*na, 自己和以下隐藏
* */
const media = (props) => {
  const {mb,mba,mn,mna,db,dba,dna,dn,tb,tba,tn,tna,pb,pn} = props;
  let css;

  if(mb && typeof mb === 'boolean'){ //仅在大桌面显示
    css = `@media only screen and (max-width: 1199px) {display:none;}`;
  }

  if(mn && typeof mn === 'boolean'){ //仅在大桌面隐藏
    css = `@media only screen and (min-width:1200px)  {display:none;}`;
  }

  if(mba && typeof mba === 'boolean'){ //全显示
    css = `{display:block;}`;
  }

  if(mna && typeof mna === 'boolean'){ //全隐藏
    css = `{display:none;}`;
  }

  //992 ~ 1199
  if(db && typeof db === 'boolean'){ //仅在桌面显示
    css = `@media only screen and (max-width:991px) {display:none;}  @media only screen and (min-width: 1200px) {display:none;}`;
  }

  if(dn && typeof dn === 'boolean'){ //仅在桌面隐藏
    css = `@media screen and (min-width:992px) and (max-width:1199px) {display:none;}`;
  }

  if(dba && typeof dba === 'boolean'){ //仅在桌面及以下分辨率显示
    css = `@media only screen and (min-width:1200px)  {display:none;}`;
  }

  if(dna && typeof dna === 'boolean'){ //仅在桌面及以下分辨率隐藏
    css = `@media only screen and (max-width: 1199px) {display:none;}`;
  }

  //768 ~ 991 平板
  if(tb && typeof tb === 'boolean'){  //仅在平板显示
    css = `@media only screen and (max-width: 767px) {display:none;} @media only screen and (min-width: 992px) {display:none;} `;
  }

  if(tn && typeof tn === 'boolean'){ //仅在平板隐藏
    css = `@media only screen and (min-width:768px) and (max-width:991px) {display:none;}`;
  }

  if(tba && typeof tba === 'boolean'){ //在平板及以下分辨率显示
    css = `@media only screen and (min-width: 992px)  {display:none;}`;
  }

  if(tna && typeof tna === 'boolean'){ //在平板及以下分辨率隐藏
    css = `@media only screen and (max-width:991px)  {display:none;}`;
  }

  //0 ~ 767 手机
  if(pb && typeof pb === 'boolean'){ //仅在手机显示
    css = `@media only screen and (min-width: 768px) {display:none;}`;
  }
  if(pn && typeof pn === 'boolean'){ //仅在手机隐藏
    css = `@media only screen and (max-width: 767px) {display:none;}`;
  }

  return css;
};

/*
* 获得颜色
* c,o,over:是否激活颜色
* */
const getColor = (c,o,over) => {
  switch (c) {
    case 'p': c=o || o === 0 ? `rgba(${primaryRGB},${'.'+o})` : over ? primaryG : primary; break;
    case 's': c=o || o === 0  ? `rgba(${successRGB},${'.'+o})` : over ? successG : success; break;
    case 'd': c=o || o === 0  ? `rgba(${dangerRGB},${'.'+o})` : over ? dangerG : danger; break;
    case 'w': c=o || o === 0  ? `rgba(${warningRGB},${'.'+o})` : over ? warningG : warning; break;
    case 'i': c=o || o === 0  ? `rgba(${infoRGB},${'.'+o})` : over ? infoG : info; break;
    case 'ff': c=o || o === 0  ? `rgba(${ffRGB},${'.'+o})` : over ? ffG : ff; break;
    case 'fe': c=o || o === 0  ? `rgba(${feRGB},${'.'+o})` : over ? feG : fe; break;
    case 'fc': c=o || o === 0  ? `rgba(${fcRGB},${'.'+o})` : over ? fcG : fc; break;
    case 'f9': c=o || o === 0  ? `rgba(${f9RGB},${'.'+o})` : over ? f9G : f9; break;
    case 'f6': c=o || o === 0  ? `rgba(${f6RGB},${'.'+o})` : over ? f6G : f6; break;
    case 'f3': c=o || o === 0  ? `rgba(${f3RGB},${'.'+o})` : over ? f3G : f3; break;
    case 'f0': c=o || o === 0  ? `rgba(${f0RGB},${`.${o}`})` : over ? f0G : f0; break;
    case 'bg': c=o || o === 0  ? `rgba(${bgRGB},${`.${o}`})` : over ? bgG : bg; break;
    case 'bp': c=o || o === 0  ? `rgba(${bpRGB},${`.${o}`})` : over ? bpG : bp; break;
    case 'bs': c=o || o === 0  ? `rgba(${bsRGB},${`.${o}`})` : over ? bsG : bs; break;
    case 'bd': c=o || o === 0  ? `rgba(${bdRGB},${`.${o}`})` : over ? bdG : bd; break;
    case 'bw': c=o || o === 0  ? `rgba(${bwRGB},${`.${o}`})` : over ? bwG : bw; break;
    case 'bi': c=o || o === 0  ? `rgba(${biRGB},${`.${o}`})` : over ? biG : bi; break;
    default: c = o || o === 0  ? `rgba(${ffRGB},${`.${o}`})` : ''; break;
  }
  return c;
};

/*
* 获得渐变
* */
const getGradient = (bg) => {
  let gs = '', ge = '';
  switch (bg) {
    case 'p':
      gs = primary; ge = primaryG; break;
    case 's':
      gs = success; ge = successG; break;
    case 'd':
      gs = danger; ge = dangerG; break;
    case 'w':
      gs = warning; ge = warningG; break;
    case 'i':
      gs = info; ge = infoG; break;
    case 'ff':
      gs = ff; ge = ffG; break;
    case 'fe':
      gs = fe; ge = feG; break;
    case 'fc':
      gs = fc; ge = fcG; break;
    case 'f9':
      gs = f9; ge = f9G; break;
    case 'f6':
      gs = f6; ge = f6G; break;
    case 'f3':
      gs = f3; ge = f3G; break;
    default:
      gs = ff; ge = ffG; break;
  }
  return [gs,ge]
};

/*
* 设置背景渐变
* */
const setBackground = (bg,g) => {
  const [gs,ge] = getGradient(bg);
  return `
        background-color: ${gs};
