 */
const rounded = (props) => {
  const {r} = props;
  let rounded = '';
  if(r){
    if(typeof r === 'number'){
      rounded = `${r}px`;
    }
    if(typeof r === 'object'){
      r.forEach(i => rounded = rounded+`${i}px `)
    }
  }
  return `border-radius:${r === 0 ? '0' : rounded};`;
};

